import React from "react";

export default class ParkList extends React.Component {
    state = {
        loading: true,
        Allparks: null,
    };

    async componentDidMount() {
        const url = "https://developer.nps.gov/api/v1/parks?&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE";
        const response = await fetch(url);
        const data = await response.json();
        this.setState({ park: data.data, loading: false });
    }

    render() {
        return (
            <div>
               {this.state.loading || !this.state.park ? (<div>loading... </div>
               ) : (
                    <div>
                        <div>{this.state.park.fullName}</div>
                        <div>{this.state.park.description}</div>
                        <div>{this.state.park.parkCode}</div>
                        <div>{this.state.park.url}</div>
                    </div>
                )}
            </div>
        )

   }
}
